import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Navbar'; // Navigationsmenyn
import Home from './Home';
import MinHistoria from './MinHistoria';
import About from './About';
import AudioUploader from './AudioUploader'; // Din befintliga AudioUploader-komponent

const App = () => {
  return (
    <Router>
      <Navbar /> {/* Navigationsmenyn */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/min-historia" element={<MinHistoria />} />
        <Route path="/about" element={<About />} />
        <Route path="/audio-uploader" element={<AudioUploader />} /> {/* Lägg till din befintliga ljuduppladdning här */}
      </Routes>
    </Router>
  );
};

export default App;
